import { BrowserRouter, Route, Routes } from 'react-router-dom'
import ExpiredLotComponent from './Components/ExpiredLotComponent.js';
import HeaderComponent from './Components/HeaderComponent.js';
import LiveAuctionDetails from './Components/LiveAuctionDetails.js';
import LiveAuctionComponent from './Components/LiveAuctionComponent.js';
import LotsComponent from './Components/LotsComponent.js';
import NevbarComponent from './Components/NevbarComponents.js'
import SoledLotsComponent from './Components/SoledLotsComponent.js';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route element={<NevbarComponent />} />
          <Route element={<HeaderComponent />} />
          <Route path='/' element={<LotsComponent />} />
          <Route path='/live' element={<LiveAuctionComponent />} />
          <Route path='/sold' element={<SoledLotsComponent />} />
          <Route path='/expired' element={<ExpiredLotComponent />} />
          <Route path='/liveauction/:id' element={<LiveAuctionDetails />} />
          <Route path='/userP/:id' element={<LiveAuctionDetails />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
